import React, {useState, useEffect}from "react";
import Navbar from "./NavBar";
import axios from 'axios';
import "../styles/Portfolio.css";
import { Link } from 'react-router-dom';

function Portfolio() {


    const [stocks, setStocks] = useState([]);

    const [userdata, setUserdata] = useState([])

    useEffect(()=>{
        async function getportfolio(){
            try {
                const userdata = await axios.get('http://localhost:8000/userdata/')
                console.log(userdata.data)
                setUserdata(userdata.data)

            } catch (error) {
                console.log(error)
            }
        } getportfolio();

    },[])


    return(
        <>
        <div className="Portfolio">
            <Navbar/>
        </div>
        <div className="portfolio">
            {
                userdata.map((user,i)=>{ return(
                    <ul className="userheading">
                        <h1>{user.name}'s Portfolio</h1>
                        <p>Username: {user.username}</p>
                        <p>Age: {user.age}</p>
                        <p>Profit: Rs. {user.profit}</p>
                        <p>Loss: Rs. {user.loss}</p>
                        <p>Balance: Rs. {user.balance}</p>
                    </ul>
                )
                })
            }

            <h2>Stocks</h2>
            <ul>
                {stocks.map(stock => (
                <li key={stock.symbol}>
                    <p>{stock.name} ({stock.symbol})</p>
                    <p>Quantity: {stock.quantity}</p>
                </li>
                ))}
            </ul>
    </div>
    <Link to="http://127.0.0.1:8050" className="button-link">
      <button>Check your Real Time Data Analysis of Stocks here...</button>
      </Link>
        </>
    );
}

export default Portfolio;
